import React from "react";

// reactstrap components
import { Container, Row, Col } from "reactstrap";
import NameCard from "../../assets/img/card.png";

// core components

function Images() {
  return (
    <>
      <div className="section section-images">
        <Container>
          <Row>
            <Col md="2">
            </Col>

            <Col md="8">
              <img src={NameCard}/>
            </Col>

            <Col md="2">
            </Col>
          </Row>
        </Container>
      </div>
    </>
  );
}

export default Images;
